import { useEffect, useState } from "react";
import { Header } from "./components/header";

function App() {
  const [users, setUsers] = useState<any[]>([]);

  useEffect(() => {
    fetch("http://localhost:3001/api/users")
      .then((res) => res.json())
      .then((data) => setUsers(data));
  }, []);

  return (
    <>
      <Header />
      <DrawerMenu />
      <Categories />
    </>
  );
}

export default App;
